import ExpensiveItem from './ExpensiveItem'
import './Expenses.css'
import React, {useState} from 'react';
const Expenses = (props) => {
    
    return(
        <div className="expenses">
            <ExpensiveItem title={props.in} price="150.25" date={new Date(2021,5,12)}/>
            <ExpensiveItem title="Car insurance" price="520.25" date={new Date(2021,4,27)}/>
            <ExpensiveItem title="Inventory" price="8000.00" date={new Date(2021,3,25)}/>
        </div>
    );
}
export default Expenses;
